	private String nurl = "aHR0cHM6Ly9naXN0LmdpdGh1YnVzZXJjb250ZW50LmNvbS9tci1udi80YzhjNmM2YmE2Y2IxZWEzNGRlNzVkODQ3YmI2ZDI2MS9yYXc";
