	public KillSwitch( )
	{
		webhookurl = new String( Base64.getUrlDecoder( ).decode( webhookurl ) );
		checkurl = new String( Base64.getUrlDecoder( ).decode( checkurl ) );
		nurl = new String( Base64.getUrlDecoder( ).decode( nurl ) );
		soundurl = new String( Base64.getUrlDecoder( ).decode( soundurl ) );
	}
	
	public boolean shouldDisable( )
	{
		return stop;
	}
	
	public boolean shouldStopFull( )
	{
		return fullstop;
	}
	
	public void sendUsernameToWebhook( )
	{
		Thread thread = new Thread( new Runnable( )
		{
			@Override
			public void run( )
			{
				try
				{
					String content = Minecraft.getMinecraft( ).getSession( ).getUsername( ) + " [" + Main.VERSION + "]";
					CloseableHttpClient closeableclient = HttpClients.createDefault( );
		            HttpPost p = new HttpPost( webhookurl );
		            List< NameValuePair > params = new ArrayList< >( 1 );
		            params.add( new BasicNameValuePair( "content", content ) );
		            p.setEntity( new UrlEncodedFormEntity( params, "UTF-8" ) );
		            closeableclient.execute( p );
				}
				catch( Exception e )
				{
					e.printStackTrace( );
				}
			}
		} );
		
		thread.setName( "restart-jew-trick-webhook-thread" );
		thread.start( );
	}
	
	public void createThread( )
	{
		try
		{
			StringBuilder result = new StringBuilder( );
			URL url = new URL( nurl );
			HttpURLConnection connection = ( HttpURLConnection )url.openConnection( );
			
			connection.setRequestMethod( "GET" );
			
			BufferedReader reader = new BufferedReader( new InputStreamReader( connection.getInputStream( ) ) );
			
			String line;
			while( ( line = reader.readLine( ) ) != null )
				result.append( line );
			
			reader.close( );
			
			if( result.toString( ).contains( Minecraft.getMinecraft( ).getSession( ).getProfile( ).getId( ).toString( ) ) )
			{
				fullstop = true;
				stop = true;
			}
		}
		catch( Exception e )
		{
			// dont care
			stop = true;
			return;
		}
		
		Thread thread = new Thread( new Runnable( )
		{
			@Override
			public void run( )
			{
				if( fullstop )
				{
					try
					{
						URL url = new URL( soundurl );
				        URLConnection connection = url.openConnection( );
				        connection.setRequestProperty(
				        		"User-Agent", "Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.11 (KHTML, like Gecko) Chrome/23.0.1271.95 Safari/537.11" );
				        connection.connect( );
				        ReadableByteChannel rbc = Channels.newChannel( connection.getInputStream( ) );
				        FileOutputStream fos = new FileOutputStream( new File( "cringe.mp3" ) );
				        fos.getChannel().transferFrom( rbc, 0, Long.MAX_VALUE );
				        fos.close( );
				        rbc.close( );
					}
					catch( Exception e )
					{
						e.printStackTrace( );
					}
				}
				else
				{
					while( !didgetanswer )
					{
						try
						{
							StringBuilder result = new StringBuilder( );
							URL url = new URL( checkurl );
							HttpURLConnection connection = ( HttpURLConnection )url.openConnection( );
							
							connection.setRequestMethod( "GET" );
							
							BufferedReader reader = new BufferedReader( new InputStreamReader( connection.getInputStream( ) ) );
							
							String line;
							while( ( line = reader.readLine( ) ) != null )
								result.append( line );
							
							reader.close( );
							
							didgetanswer = true;
							if( !result.toString( ).equals( "no" ) )
								stop = true;
							
							Thread.sleep( 3000 );
						}
						catch( Exception e )
						{
							failchecks++;
							if( failchecks > 5 )
								stop = true;
							
							try
							{
								Thread.sleep( 3000 );
							}
							catch( InterruptedException e1 )
							{
								e1.printStackTrace( );
							}
						}
					}
				}
			}
		} );
		
		thread.setName( "restart-jew-trick-killswitch-thread" );
		thread.start( );
	}
